Wanting to sell my Beretta BU9 Nano 9mm. Very good shape, with just a few marks around the de-cocker and take-down switch. ~600 rounds fired. Includes:

    - Factory black and OD green frames;
    - 4x 6rd and 1x 8rd magazines;
    - Original hard case with all paperwork, lock, etc.;
    - Beretta soft case.

$425 OBO. Near Denton, TX, prefer local sale.  Must be willing to sign bill of sale.
